CONSTRUCTION SERVICES AND COST REIMBURSEMENT AGREEMENT
FOR AFFECTED SYSTEM PROJECT


	This Construction Services and Cost Reimbursement Agreement for Affected System Project (“Agreement”) made as of May 22, 2024, is by and between NextEra Energy Seabrook, LLC, a Delaware limited liability company (“Affected Party”) on behalf of itself and as agent for the other owners of Seabrook Station (the “Affected System”), which are Massachusetts Municipal Wholesale Electric Company, Hudson Light & Power Department, and Taunton Municipal Lighting Plant (the “Joint Owners”); and NECEC Transmission LLC, a Delaware limited liability company (“NECEC”), and sets forth the agreement between the Parties concerning the construction, implementation, and testing activities to be engaged in by Affected Party at the request of NECEC.  Affected Party and NECEC are collectively referred to herein as the “Parties” and each individually as a “Party”.

RECITALS

WHEREAS, NECEC is proposing to develop the New England Clean Energy Connect (the “Facility”), an Elective Transmission Upgrade initially designated by ISO New England Inc. (“ISO-NE”) as Queue Position 639, pursuant to which this Agreement is based;

WHEREAS, the Facility consists of a unidirectional HVDC line and certain AC upgrades from the 735 kV Appalaches Substation in Quebec to Central Maine Power Company’s 345 kV Larrabee Road Substation in Lewiston, Maine; 

WHEREAS, the System Impact Study for the Facility, conducted under ISO-NE’s Open Access Transmission Tariff (“Tariff”) Schedule 25-Elective Transmission Upgrade Interconnection Procedures, stated the duty on the Affected System’s 24.5 kV generator circuit breaker was operating within its rating until the addition of the Facility, which caused a significant adverse impact on the 24.5 kV generator circuit breaker and ancillary equipment due solely to the addition of the Facility and, therefore, requires an upgrade to accommodate the Facility, which upgrade is necessary to avoid any significant adverse impact on the reliability, stability, and operability of the Affected System (“Significant Adverse Impact on the Affected System”);

WHEREAS, NECEC’s responsibility to alleviate the Significant Adverse Impact on the Affected System by ensuring completion of an upgrade to the Affected System (the “Upgrade”) is memorialized in the Elective Transmission Upgrade Interconnection Agreement by and between ISO-NE, NECEC, and Central Maine Power Company, dated November 6, 2020 (the “Interconnection Agreement”), and such upgrade is included as a requirement of the Facility’s approval under Section I.3.9 of the Tariff; 

	WHEREAS, in connection with the Upgrade, on August 13, 2021, the Parties entered into that certain Engineering and Procurement Agreement (“E&P Agreement”) that was accepted for filing by the Federal Energy Regulatory Commission (“FERC”) in NextEra Energy Seabrook, LLC¸ Docket No. ER21-2719-000, Letter Order (Oct. 4, 2021);

	WHEREAS,  in connection with the Upgrade, on August 31, 2022, the Parties entered into that certain Amended and Restated Engineering and Procurement Agreement that was accepted for filing by FERC in NextEra Energy Seabrook, LLC¸ Docket No. ER22-2807-000, Letter Order (Oct. 24, 2022), as further amended on March 30, 2023 and November 13, 2023 (“A&R E&P Agreement”), which established the terms and conditions to implement and complete the procurement and design phase for the design, engineering, planning, and procurement of material and equipment by Affected Party necessary to address the Significant Adverse Impact on the Affected System;

	WHEREAS, the terms and conditions of the A&R E&P Agreement apply to the engineering and delivery of, and associated milestone payments for, a new 24.5 kV generator circuit breaker and ancillary equipment (the “Breaker”) to Affected System in advance of the outage planned for Affected System, scheduled for a date certain in the fall of 2024 that has been discussed between the Parties and confirmed by Affected Party but is not specified in this Agreement because the date is treated as confidential market information by ISO-NE (the “Fall 2024 Planned Outage”);

	WHEREAS, the Parties desire to enter into this Agreement to set forth the terms of Affected Party’s performance related to the construction, implementation, and testing of the Breaker, including pre-Fall 2024 Planned Outage work that will commence following the Effective Date of this Agreement, as defined below, and NECEC’s reimbursement of the costs necessarily and otherwise reasonably incurred by Affected Party in connection with the Upgrade; 

	WHEREAS, FERC issued orders in Docket Nos. EL21-3 and EL216, available at 182 FERC ¶ 61,044 (Feb. 1, 2023) and 183 FERC ¶ 61,196 (June 15, 2023) (the “FERC Orders”), and Affected Party and NextEra Energy Resources, LLC petitioned the D.C. Circuit for review of the FERC Orders on April 4, 2023, and August 11, 2023 (the “Petitions”), which are pending under Case Nos. 231094 and 231215; and

WHEREAS, Affected Party is entering into this Agreement for itself as owner in its capacity as agent for the Joint Owners of the Affected System, pursuant to its authority under the Agreement for Joint Ownership, Construction and Operation of New Hampshire Nuclear Units, dated May 1, 1973 (as amended from time to time), and the Managing Agent Operating Agreement dated June 29, 1992. 

NOW, THEREFORE, in consideration of and subject to the mutual covenants contained herein the Parties agree as follows:

1. Retention of Affected Party.  Subject to the terms and conditions set forth in this Agreement, NECEC hereby retains Affected Party to perform the services necessary to complete the Upgrade during the Fall 2024 Outage, as set forth in Exhibit A (the “Services”), and Affected Party accepts such retention subject to such terms and conditions.

2.	Term.  The term of this Agreement (“Term”) shall commence as of the Effective Date and, unless earlier terminated in accordance with the terms of this Agreement, shall terminate on the later of December 1, 2024, and the in-service date of the Upgrade project.  Affected Party shall use Reasonable Efforts, as defined in Section 12 of this Agreement, to complete installation and testing of the Upgrade during the Fall 2024 Planned Outage. 

3.	Scope of Services.  The Services shall include the services set forth in Exhibit A to this Agreement and any such additional services as the Parties may agree to in writing from time to time.  To the extent Affected Party enters into one or more agreements for the construction of the Upgrade with third parties, such agreements shall include suspension and termination for convenience provisions that can reasonably effectuate the purpose of such limitations in the Sections 8 and 9 herein.

4.	Recitals.  The Recitals above are hereby incorporated into and made part of this Agreement. 

5.	Date.  When filing this Agreement with FERC pursuant to section 205 of the Federal Power Act, Affected Party shall request that the Agreement become effective one (1) day after filing, and the actual effective date of the Agreement shall be on the date as specified by FERC (the “Effective Date”).  If the Agreement is not accepted or approved by FERC in the same form as filed, the Parties agree to pursue mutually acceptable modifications to the Agreement.  

6.	Compensation and Payment.  

(a) Reimbursable Costs.  NECEC shall pay Affected Party for all costs and expenses actually incurred by Affected Party, its subcontractors and/or its “affiliates,” used here and elsewhere in this Agreement as defined by the Securities and Exchange Commission in Rule 12b-2 under the Securities Exchange Act of 1934, as amended, in performing the Services associated with effectuating the Upgrade (“Reimbursable Costs”) under this Agreement, as set forth in Exhibit A.   Reimbursable Costs shall include, but shall not be limited to, the actual cost and expenses (whether incurred before or after the effective date of this Agreement) of equipment, labor (including internal labor), materials and services, all applicable overhead costs (including direct charges and applicable federal, state and local taxes), all costs of outside experts, consultants, contractors and other third parties, all costs of obtaining any required rights, releases, consents, authorizations and approvals, and other costs and expenses necessarily or otherwise reasonably incurred in the performance of the Services that have not previously been paid pursuant to the E&P Agreement or A&R E&P Agreement; PROVIDED, HOWEVER, THE PARTIES ACKNOWLEDGE THAT THE SCOPE OF REIMBURSABLE COSTS IS SUBJECT TO THE D.C. CIRCUIT’S DECISION REGARDING THE PETITIONS AND ANY FERC ORDER ADDRESING A SECTION 205 FILING BY AFFECTED PARTY PURSUANT TO SECTION 25 OF THIS AGREEMENT.    

(b) Initial Payment.  The estimated Reimbursable Costs associated with the Services provided through this Agreement equal $8,911,093 (“Estimated Total Payment Amount”).  Within fourteen (14) days after filing this Agreement with FERC, NECEC shall pay Affected Party the initial payment (“Initial Payment”) in the amount of $2,500,000 (“Initial Payment Amount”).  

(c) Payment Security.  Within fourteen (14) days after the filing of this Agreement with FERC, NECEC shall provide Affected Party a letter of credit that is reasonably acceptable to Affected Party and is consistent with the Uniform Commercial Code of the jurisdiction of the State of New Hampshire (“Payment Security”).  Such letter of credit shall be in the amount of the Estimated Total Payment Amount less the Initial Payment Amount.  On and after the date on which NECEC provides Payment Security, Payment Security shall be reduced on a dollar-for-dollar basis after Affected Party’s receipt of the corresponding amount of each of the Initial Payment and Final Payment and any other payment that is not an RE Payment (as defined below).

(d) Final Payment.  On September 1, 2024 (“Final Payment Date”), NECEC shall pay Affected Party the final payment (“Final Payment”), which shall be the Estimated Total Payment Amount minus the Initial Payment Amount (such amount, the “Final Payment Amount.”)  

(e) Pricing Estimates and Revisions.  The Parties acknowledge that the Estimated Total Payment Amount provided in Section 6(b) is an estimate based on the information concerning Services available to the Affected Party as of the date of this Agreement, and that it is reasonably foreseeable that such estimate may be revised.  At any time, should Affected Party determine reasonably that the Estimated Total Payment Amount set forth in Section 6(b) is insufficient to cover the Reimbursable Costs to be incurred by Affected Party, then Affected Party shall provide notice to NECEC, in accordance with Section 22, including a revised cost estimate (a “Revised Estimate”) and invoice reflecting the reasons for such increased costs within ten (10) calendar days of the date that Affected Party becomes aware of the need for a Revised Estimate.  

(i) NECEC shall pay to Affected Party the amount by which the Revised Estimate exceeds the Estimated Total Payment Amount (such payment, the “RE Payment”) within ten (10) calendar days following receipt of the Revised Estimate. 

(ii) If NECEC disputes a Revised Estimate (a “RE Dispute”) that triggers an RE Payment, then NECEC shall pay to Affected Party all disputed and undisputed amounts in accordance with Section 6(e)(i) and may, within fifteen (15) calendar days following receipt of a Revised Estimate, provide written notice to Affected Party of the RE Dispute, including the basis for the dispute.

(iii) In the event of an RE Dispute, the Parties may voluntarily engage to resolve a RE Dispute.

(iv) Once the Upgrade and related Services have been completed, Affected Party shall (a) submit an invoice to NECEC setting forth the expenses incurred associated with the Services performed, including charges incurred pursuant to direct charges related to the Upgrade, and (b) promptly return to NECEC any excess funds that were not expended for direct costs associated with constructing the Upgrade, and shall do so no later than thirty (30) calendar days following the synchronization of Seabrook Station to the ISO-NE Administered Transmission System following completion of the Fall 2024 Planned Outage.

(f) Suspension of Services.  Affected Party may suspend Services if (i) the Initial Payment or the Final Payment has not been timely paid, or (ii) if NECEC fails to submit an RE Payment associated with an RE Dispute within ten (10) calendar days following receipt of a Revised Estimate.  Affected Party shall provide notice to NECEC of its intention to suspend Services in writing and NECEC shall have the shorter of five (5) business days thereafter or one (1) calendar day prior to the initiation of the Fall 2024 Planned Outage to cure prior to suspension and such notice to NECEC shall state the date on which the Fall 2024 Planned Outage is to commence if applicable, provided, however, if the Reimbursable Costs associated with further Services are greater than the remaining funds from the Initial Payment or RE Payments received by Affected Party, no notice or cure period shall be required and Affected Party shall be entitled to immediately suspend the Services; provided, further, that Affected Party will use Reasonable Efforts to provide NECEC no less than five business (5) days’ notice before the commitment of Reimbursable Costs associated with further Services and cancellation fees are expected to become greater than the remaining funds from the Initial Payment and RE Payments received by Affected Party.  NECEC acknowledges that suspension by Affected Party due to NECEC’s failure to timely cure following notice may result in cancellation of the Upgrade during the Fall 2024 Outage.     

7.  Schedule, Progress Updates, and Fall 2024 Planned Outage Commencement Date.  

(a) Updates on Progress and Delays.   If the Fall 2024 Planned Outage schedule directly related to the construction, implementation and testing of the Upgrade becomes materially delayed such that a material increase in the Reimbursable Costs or Revised Estimate is expected, Affected Party shall notify NECEC promptly and advise NECEC of the estimated amount of the expected cost increase or expected extension of the Fall 2024 Planned Outage.  Such notification shall be given no later than five (5) calendar days after Affected Party becomes aware of any such material increase in the Reimbursable Costs or Revised Estimate.  For purposes of this Section 7(a), the threshold for materiality shall be Affected Party’s good faith estimate of an increase in costs from a schedule delay of $1 million or more. 

(b) Fall 2024 Planned Outage Commencement Date.  Affected Party represents that the Fall 2024 Planned Outage is scheduled for a date certain that has been shared with NECEC.  The actual date of the commencement of the Fall 2024 Planned Outage is not included in this Agreement because it is treated as confidential market information by ISO-NE.

8.  Suspension by NECEC.  NECEC may, any time prior to the commencement of the Fall 2024 Outage and in its sole discretion, by written notice to the Affected Party (“Suspension Notice”), suspend the performance of all Services.  To be timely, such Suspension Notice shall be provided no later than September 5, 2024 (a “Timely Suspension Notice”); provided, however, that the date for a Timely Suspension Notice may change on a day for day basis if the commencement date of the Fall 2024 Planned Outage changes and Affected Party shall promptly inform NECEC of such change; provided, however, should an emergent issue arise that Affected System determines warrants Seabrook Station commencing the Fall 2024 Planned Outage prior to the deadline for receipt of a Timely Suspension Notice, NECEC shall have 48 hours to provide a Timely Suspension Notice from the receipt of notice in accordance with Section 22 of this Agreement.  NECEC acknowledges that if a Suspension Notice is delivered after that date, NECEC will be liable for all costs incurred by Affected Party associated with the construction, installation, and testing of the Breaker.  Either party may inform FERC and/or ISO-NE collectively, if mutually agreed upon, or individually, if either party determines agreement cannot be reached, that NECEC has caused the upgrade to be cancelled during the Fall 2024 Planned Outage due to its Timely Notice.  

(a) Upon receipt of a Timely Suspension Notice, the Affected Party shall:

1. use Reasonable Efforts to direct subcontractors and employees immediately to discontinue all Services;

2. place no further orders or subcontracts for material, services, or facilities with respect to the Services;

3. suspend all engineering subcontracts and, to the extend reasonably practicable, suspend all materials purchases;

4. exercise Reasonable Efforts to minimize cost or expenses arising out of the suspension, if any; and

5. as soon as reasonably practicable, inform NECEC of any additional Reimbursable Costs, if any, arising from such suspension.

(b) In the event of a Timely Suspension Notice, NECEC and the Affected Party will continue communications and coordination regarding their obligations under this Agreement.

9.	Termination By NECEC.  NECEC may, any time up to the commencement of the Fall 2024 Planned Outage and in its sole discretion, by written notice to the Affected Party (“Termination Notice”), terminate the performance of all Services; provided, however, that such written notice must be delivered to Affected Party no later than September 5, 2024 (a “Timely Termination Notice”); provided further that the date for providing notice of termination may change on a day for day basis if the commencement date of the Fall 2024 Planned Outage changes and Affected Party shall promptly inform NECEC of such change; provided, however, should an emergent issue arise that Affected System determines warrants Seabrook Station commencing the Fall 2024 Planned Outage prior to the deadline for receipt of a Timely Termination Notice, NECEC shall have 48 hours to provide a Timely Termination Notice from the receipt of notice in accordance with Section 22 of this Agreement.  NECEC acknowledges that it is liable for costs incurred by Affected Party prior to receipt of such notice and costs that are incurred to effectuate termination of services following such notice, as set forth below.  NECEC further acknowledges that if a Termination Notice is delivered after that date, NECEC will be subject to the payment of all costs associated with the construction, installation, and testing of the Breaker.  Either party may inform FERC and/or ISO-NE collectively, if mutually agreed upon, or individually, if either party determines agreement cannot be reached, that NECEC has caused the upgrade to be cancelled due to its notice to terminate.  Should NECEC elect to terminate the Services, the Affected Party shall with respect to the Services and consistent with Good Utility Practice:

(a) use Reasonable Efforts to direct subcontractors and employees immediately to discontinue all Services;

(b) place no further orders or subcontracts for material, services, or facilities;

(c) terminate all engineering subcontracts; 

(d) as soon as reasonably practicable, inform NECEC if any amounts incurred by Affected Party exceed the amount paid by NECEC prior to the termination date, Affected Party shall invoice NECEC for such additional amounts (including, without limitation, amounts related to winding up Services incurred in connection with the cancellation of third-party contracts) and NECEC shall pay such amount to Affected Party within thirty (30) days of receipt of such invoice;

(e) exercise Reasonable Efforts to minimize cost or expenses arising out of termination; and

(f) maintain books and records supporting all costs charged to NECEC in connection with the termination, and as soon as reasonably practicable provide NECEC with an invoice for all costs due in connection with its termination including all required termination payments (the “Termination Invoice”) and, if any amounts paid by NECEC pursuant to this Agreement prior to termination remain unspent after completion of the Services contemplated by this Agreement or after paying the costs associated with the termination of the Services shall be returned to NECEC within the latter of (i) thirty (30) days following such termination or (ii) within fifteen (15) days following the completion of the Fall 2024 Planned Outage.

10.	Status of Affected System as Independent Contractor.  Affected Party shall perform the Services as an independent contractor and not as a subcontractor, agent or employee of NECEC or any of NECEC’s affiliates, and NECEC shall have no control over Affected Party or Affected Party’s employees or over the manner or methods of performance of Services.  Neither Party shall have any authority to bind, or otherwise act on behalf or in the name of, the other Party.

11.	Business Records.  Affected Party shall maintain books and records supporting all costs for Services, and during Affected Party’s normal business hours during the term of this Agreement and for a period of one year after all Services pursuant to this Agreement have been completed and any disputes arising therefrom have been resolved, NECEC shall have such access to such books and records as shall be required to verify Reimbursable Costs and otherwise ensure Affected Party’s compliance with the terms of this Agreement.

12.	Reasonable Efforts.  Reasonable Efforts shall have the meaning defined in ISO-NE Tariff Schedule 25-Elective Transmission Upgrade Interconnection Procedures.  Reasonable Efforts is defined therein, in part, as being timely and consistent with “Good Utility Practice.”  For purposes of this Agreement, Good Utility Practice means any of the practices, methods and acts engaged in or approved by a significant portion of the U.S. nuclear industry during the relevant time period, or any of the practices, methods and acts which, in the exercise of reasonable judgment in light of the facts known at the time the decision was made, could have been expected to accomplish the desired result at a reasonable cost consistent with good business practices, reliability, safety and expedition.  Good Utility Practice is not intended to be limited to the optimum practice, method, or act to the exclusion of all others, but rather includes all acceptable practices, methods, or acts generally accepted in the region, including those practices required by Federal Power Act section 215(a)(4).
13.	No Warranties.  Affected Party makes no warranties, express or implied, whether arising by operation of law, course of performance or dealing, custom, usage in trade or profession, or otherwise, including without limitation implied warranties of merchantability and fitness for a particular purpose, with regard to the activities to be performed pursuant to this Agreement.  Affected Party is providing no guarantee or warranty that the Services to be provided under this Agreement will result in a proper interconnection of the Facility or resolve the Significant Adverse Impact on the Affected System.  
14.	Limitation of Liability.  Affected Party shall not be liable for money damages or other compensation to NECEC for actions or omissions by Affected Party in performing its obligations under this Agreement, except to the extent such act or omission by Affected Party is judicially determined to result from its gross negligence or willful misconduct.  
15.	Waiver of Consequential Damages.  WITH REGARD TO THE LIMITED SCOPE OF THIS AGREEMENT ONLY, IN NO EVENT SHALL EITHER PARTY BE LIABLE TO THE OTHER PARTY FOR CONSEQUENTIAL, INCIDENTAL, PUNITIVE, EXEMPLARY, OR INDIRECT DAMAGES, LOST PROFITS, OR OTHER BUSINESS INTERRUPTION DAMAGES, BY STATUTE, IN TORT OR CONTRACT, UNDER ANY INDEMNITY PROVISION OF ANY AGREEMENT, OR OTHERWISE; PROVIDED, HOWEVER, THAT THE PARTIES ACKNOWLEDGE THAT, TO THE EXTENT APPLICABLE IN THIS SECTION 15, THE SCOPE OF SUCH WAIVER IS SUBJECT TO THE D.C. CIRCUIT’S DECISION REGARDING THE PETITIONS AND ANY FERC ORDER ADDRESING A SECTION 205 FILING BY AFFECTED PARTY PURSUANT TO SECTION 25 OF THIS AGREEMENT.  
16.	No Impact on Prior Actions.  This Agreement is not intended to affect the Affected Party and NextEra Energy Resources, LLC’s pending appeal in NextEra Energy Resources, LLC v. Federal Energy Regulatory Commission, Nos. 23-1094 (D.C. Cir. filed Apr. 4, 2023).  
17.	Confidentiality.  Each Party shall use at least the same standard of care to protect confidential information it receives as it uses to protect its own confidential information from unauthorized disclosure, publication, or dissemination.  The date for the commencement of the Fall 2024 Planned Outage is non-public market information and thereby is treated as confidential.  Each Party may use confidential information solely to fulfill its obligations to the other Party under this Agreement.

18.	Standard of Performance.  Affected Party shall perform the Services in accordance with (i) the standards of care, diligence, skill and judgement normally exercised by professional firms and individuals with respect to services of a similar nature, (ii) recognized and sound utility practices, procedures and techniques, and (iii) all applicable laws and regulations.

19.	Modifications.  No amendment or other modification to this Agreement shall be effective unless made in writing and signed by both of the Parties. 

	20.  	Conflict with Tariff.  This Agreement is executed pursuant to a request under the ISO-NE Tariff Schedule 25 Elective Transmission Upgrade Interconnection Procedures.  In the event of a conflict between this Agreement and the Tariff, including as it may be amended in the future, this Agreement shall control.

