34.	Force Majeure.  

(a)	Definition.  Except for any failure to make payments when due, neither Party shall be responsible for its failure to perform under this Agreement to the extent that such failure is caused by a Force Majeure Event or the acts or omissions of the other Party, including any of the other Party’s affiliates or contractors or any other person or entity for whom or which the other Party or any of its affiliates is responsible.  For the purposes of this Agreement, “Force Majeure Event” means any event or circumstance that, despite the commercially reasonable efforts of the Party claiming relief for such event or circumstance to avoid or mitigate the effects of such event or circumstance, is beyond the reasonable control of such Party and shall include, but shall not be limited to, blizzards, earthquakes, floods, hurricanes, tornados, windstorms, and other so-called acts of God, explosions, fires, riots, sabotage, terrorism or threat thereof, and war, strikes and other labor disputes and slow-downs, injunctions and other court orders (excluding any injunction or other court order pursuant to a claim by one Party against the other Party, or a dispute between the Parties, in connection with this Agreement), governmental action (including any change in applicable law or governmental regulation) or inaction (including but not limited to any delay by any governmental authority in issuing any applicable license, permit or approval), and unavailability of equipment, personnel, supplies, or other resources due to the diversion thereof to utility-related emergencies, including but not limited to emergencies caused by severe storms or other extreme weather conditions.  

(b)	Impacts.  Upon the occurrence of a Force Majeure Event, the Party claiming relief for such Force Majeure Event shall be excused from the performance of its obligations under this Agreement, excluding payment obligations, for the duration of such Force Majeure Event to the extent that such performance is affected by such Force Majeure Event, provided that the Party claiming such Force Majeure Event shall have made all Reasonable Efforts to avoid and mitigate the effects of such Force Majeure Event and shall continue to make all Reasonable Efforts to mitigate and overcome the effects of such Force Majeure Event.  At the conclusion of a Force Majeure Event, the price and time for performance under this Agreement shall be adjusted as reasonably necessary to overcome the effect of the delay occasioned by such Force Majeure Event.  Within fifteen (15) business days after the occurrence of any Force Majeure Event, the Party claiming such Force Majeure Event shall give written notice to the other Party, specifying in reasonable detail the estimated impact of such delay.


