?AMENDED AND RESTATED ENGINEERING AND PROCUREMENT AGREEMENT FOR AFFECTED SYSTEM PROJECT
This Amended and Restated Engineering and Procurement Agreement for Affected System Project (“Agreement”), dated as of August 31, 2022, is between NextEra Energy Seabrook, LLC, a Delaware limited liability company (“Affected Party”) on behalf of itself and as agent for the other owners of Seabrook Station (the “Affected System”), which are Massachusetts Municipal Wholesale Electric Company, Hudson Light & Power Department, and Taunton Municipal Lighting Plant (the “Joint Owners”), and NECEC Transmission LLC, a Delaware limited liability company (“NECEC”), and sets forth the agreement between the Parties concerning the engineering and procurement of long lead-time items associated with work to be engaged in by Affected Party at the request of NECEC. Affected Party and NECEC are collectively referred to herein each as the “Parties” and individually as a “Party”.
RECITALS
WHEREAS, NECEC is proposing to develop the New England Clean Energy Connect (the “Facility”), an Elective Transmission Upgrade initially designated by ISO New England Inc. (“ISO-NE”) as Queue Position 639, pursuant to which this Agreement is based;
WHEREAS, the proposed Facility consists of a unidirectional HVDC line and certain AC upgrades from the 735 kV Appalaches Substation in Quebec to Central Maine Power Company’s 345 kV Larrabee Road Substation in Lewiston, Maine, and has a currently proposed commercial operation date of December 2024;
WHEREAS, the System Impact Study, conducted under ISO-NE’s Open Access Transmission Tariff (“Tariff”) Schedule 25-Elective Transmission Upgrade Interconnection Procedures for the Facility stated the duty on the Affected System’s 24.5 kV generator circuit breaker operating within its rating until the addition of the Facility, which caused a significant adverse impact on the 24.5 kV generator circuit breaker and ancillary equipment due solely to the addition of the Facility and, therefore, requires an upgrade to accommodate the Facility, which upgrade is necessary to avoid any significant adverse impact on the reliability, stability, and operability of the Affected System (“Significant Adverse Impact on the Affected System”);
WHEREAS, NECEC’s responsibility to alleviate the Significant Adverse Impact on the Affected System by ensuring completion of an upgrade to the Affected System (the “Upgrade”) is memorialized in the Elective Transmission Upgrade Interconnection Agreement by and between ISO-NE, NECEC, and Central Maine Power Company, dated November 6, 2020 (the “Interconnection Agreement”), and such upgrade is included as a requirement of the Facility’s approval under Section I.3.9 of the Tariff;
WHEREAS, in connection with the Upgrade, on August 11, 2021, the Parties entered into that certain Engineering and Procurement Agreement that was accepted for filing by the Federal Energy Regulatory Commission (“FERC”) in NextEra Energy Seabrook, LLC¸ Docket No. ER21-2719-000, Letter Order (Oct. 4, 2021) (the “Original Agreement”);
WHEREAS, NECEC pursuant to the Original Agreement paid to Affected Party the $800,000.00 (the “Initial Payment”) as payment for the estimated costs of Affected Party with respect to the engineering, conceptual design, and initial project management phase (the “Engineering Phase”);
WHEREAS, the Engineering Phase of the Upgrade work as contemplated in the Original Agreement has been completed;
WHEREAS, the Affected Party has received report(s) from contractor(s) (the “Contractor Reports”) on the development of the conceptual design package, equipment vendor proposals, and preliminary construction estimate and schedule, has provided the Contractor Reports to NECEC, and the Parties have convened a meeting (the “Initial Meeting”) to discuss the Contractor Reports, the E&P Activities and E&P Costs associated with the Procurement and Design Phase.
WHEREAS, on July 8, 2022, NECEC issued a conditional Notice to Proceed (“NTP”) with respect to the procurement and detailed design phase of this Agreement (the “Procurement and Design Phase”), and funds remaining from the Initial Payment (in an amount equal to $521,670.00) are being applied to the E&P Costs (as defined in Section 2.01 below) associated with the conditional NTP;
WHEREAS, Section 7 of the Original Agreement required that following the issuance of the NTP the Parties negotiate an amendment to incorporate the E&P Activities, the E&P Costs, and the obligations of NECEC to pay all of the E&P Costs related to the Procurement and Design Phase;
WHEREAS, rather than the required amendment, the Parties have agreed that entering into an amended and restated agreement will provide for greater clarity;
WHEREAS, Affected Party filed a Petition for Declaratory Order with the Federal Energy Regulatory Commission (“FERC”) in Docket No. EL21-3-000 on October 5, 2020 after negotiations reached an impasse, which seeks to confirm that Affected Party is not required to incur a financial loss to resolve the Significant Adverse Impact on the Affected System, among other issues;
WHEREAS, NECEC and Avangrid, Inc. filed a Complaint against Affected Party, NextEra Energy Resources, LLC, FPL Energy Wyman, LLC, and FPL Energy Wyman IV, LLC in FERC Docket No. EL21-6-000 on October 1, 2020, and an Amended Complaint against Affected Party and NextEra Energy Resources, LLC in the same docket on March 26, 2021, which seek certain relief as set forth in such Complaint and Amended Complaint;
WHEREAS, Affected Party and NECEC seek to address a number of limited issues through this Agreement, but do not seek to address any matter at issue in Docket Nos. EL21-3-000 or EL21-6-000 unless provided for herein, and will ask FERC to resolve all remaining issues between the Parties;
WHEREAS, Affected Party is entering into this Agreement for itself as owner in its capacity as agent for the Joint Owners of the Affected System, pursuant to its authority under the Agreement for Joint Ownership, Construction and Operation of New Hampshire Nuclear Units, dated May 1, 1973 (as amended from time to time), and the Managing Agent Operating Agreement dated June 29, 1992;
NOW, THEREFORE, in consideration of and subject to the mutual covenants contained herein the Parties agree as follows:
ARTICLE I. PURPOSE, EFFECTIVE DATE, AND INTERPRETATION 1.01 Purpose. The purpose of this Agreement is to establish terms and conditions that implement and complete the Procurement and Design Phase for the design, engineering, planning, and procurement of material and equipment by Affected Party necessary to address the Significant Adverse Impact on the Affected System (the “E&P Activities”), as contemplated by Section 7 of the Original Agreement, as required by the conclusions of the System Impact Study, NECEC’s concurrence and execution of the Interconnection Agreement, and as a requirement for the Facility under Section I.3.9, and the Original Agreement. Affected Party confirmed that no permits are required for the Upgrade. The Procurement and Design Phase will conclude with the delivery of a new 24.5 kV generator circuit breaker and ancillary equipment to Affected System in advance of the outage planned for Affected System in the fall of 2024 (the “Fall 2024 Planned Outage”). 1.02 Recitals. The Recitals above are hereby incorporated into and made part of this Agreement. 1.03 Effective Date. When filing this Agreement with FERC pursuant to section 205 of the Federal Power Act, Affected Party shall request that the Agreement become effective one (1) day after filing, and the actual effective date of the Agreement shall be on the date as specified by FERC (the “Effective Date”). If the Agreement is not accepted or approved by FERC in the same form as filed, the Parties agree to pursue mutually acceptable modifications to the Agreement. If the Parties cannot reach agreement on such modifications, then the Parties agree to inform FERC of such fact and that they will await the issuance of order(s) in Docket Nos. EL21-3-000 and EL21-6-000 to resolve such issues. 1.04 Principals of Interpretation. Unless otherwise required by the context in which any term appears: (a) the gender of all words used herein shall include the masculine, feminine and neuter and the singular shall include the plural; (b) unless otherwise specified, references to “Articles,” “Sections,” “Recitals,” “Schedules,” “Annexes,” “Appendices” or “Exhibits” (if any) shall be to articles, sections, schedules, annexes, appendices or exhibits (if any) of this Agreement, as the same may be amended, modified, supplemented or replaced from time to time hereunder; (c) all references to a person shall include a reference to such person’s successors and permitted assigns; (d) the words “herein,” “hereof,” “hereunder” and other words of similar import shall refer to this Agreement as a whole and not to any particular Section or subsection of this Agreement; (e) all accounting terms not specifically defined herein shall be construed in accordance with generally accepted accounting principles in the United States of America, consistently applied; (f) references to this Agreement shall include a reference to all appendices, annexes, schedules and exhibits hereto, as the same may be amended, modified, supplemented or replaced from time to time; (g) references to any agreement, document or instrument shall mean a reference to such agreement, document or instrument as the same existed on the date hereof; (h) the use of the word “including” in this Agreement to refer to specific examples shall be construed to mean “including, without limitation” or “including but not limited to” and shall not be construed to mean that the examples given are an exclusive list of the topics covered; (i) references to an applicable law shall mean a reference to such Applicable Law on the date hereof, and subject to any cost, schedule or other relief to which either Party is entitled following any change in applicable law; (j) the headings contained herein are used solely for convenience and do not constitute a part of this Agreement nor should they be used to aid in any manner to construe or interpret this Agreement. 1.05 Notice to Proceed. The execution of this Agreement by NECEC shall be deemed an unconditional and irrevocable election by NECEC pursuant to Section 7 of the Original Agreement to proceed to the full Procurement and Design Phase, as the Parties acknowledge that the NTP reflected only a conditional NTP with regard to the remaining unspent funds from the Initial Payment. 1.06 Order of Precedence. In the event of any inconsistencies in this Agreement, the following order of precedence in the interpretation hereof or resolution of such conflict hereunder shall prevail: (a) amendments, addenda or other modifications to this Agreement duly signed and issued after the signing of this Agreement, with those of a later date having precedence over those of an earlier date; (b) this Agreement; (c) the Exhibits and Schedules hereto.
ARTICLE II. COST AND PAYMENT 2.01 Payment. In accordance with the terms of this Agreement, NECEC shall reimburse and pay Affected Party all internal and external costs (including labor and material), fees, and expenses incurred by Affected Party and its affiliates with respect to the E&P Activities related to the Procurement and Design Phase, covering all costs through the delivery of the new 24.5 kV generator circuit breaker and ancillary equipment to Affected System (“E&P Costs”). This Agreement, however, does not reflect costs associated with the installation, implementation and testing of such equipment, which costs shall be included in a further amended agreement that will also reflect the determinations of the FERC in Docket Nos. EL21-3-000 or EL21-6-000. 2.02 Total Procurement and Design Phase Costs. Subject to revision pursuant to Section 2.06, the estimated E&P Costs associated with procurement of the material and equipment and detailed design required to implement the Procurement and Design Phase is $12,668,361.83 (“Procurement and Design Payment Amount”), which shall be paid in accordance with Exhibit A (Milestone Payments). The term “Milestone Payment” shall mean a payment described in Exhibit A or a Revised Exhibit A as defined in Section 2.06 herein. 2.03 Use of Initial Payment. The Parties acknowledge that funds remaining from the Initial Payment (in that amount equal to $521,670.00) are being applied to the E&P Costs associated with the conditional NTP. 2.04 Payment Security. Within seven (7) days after the filing of this Agreement with FERC, NECEC shall provide Affected Party a letter of credit that is reasonably acceptable to Affected Party and is consistent with the Uniform Commercial Code of the jurisdiction of the State of New Hampshire (the “Payment Security”). Such letter of credit shall be in the amount of $10,545,397.10. On and after the date on which NECEC provides Payment Security, Payment Security shall be reduced on a dollar-for-dollar basis after Affected Party’s receipt of the corresponding amount of each Milestone Payment; provided, however, that the letter of credit shall not be reduced below the amount of cancellation fees associated with the new the 24.5 kV generator circuit breaker and ancillary equipment. 2.05 Additional Milestone Payments. Following the Initial Payment set forth in Section 2.03 above, all future milestone payments pursuant to this Agreement shall be made in accordance with Exhibit A. 2.06 Pricing Estimates and Revisions. NECEC acknowledges that the Procurement and Design Payment Amount provided in Section 2.02 is an estimate based on the information concerning E&P Activities and E&P Costs available to the Affected Party as of the date of this Agreement, and that it is reasonably foreseeable that such estimate may be revised prior to the end of the Procurement and Design Phase. At any time, should Affected Party determine reasonably that the Procurement and Design Payment Amount set forth in Section 2.02 is insufficient to cover the E&P Costs to be incurred by Affected Party, then Affected Party shall provide notice to NECEC, in accordance with 8.13, including a revised cost estimate (a “Revised Estimate”) and a revised Exhibit A (a “Revised Exhibit A”). NECEC shall pay to Affected Party any incremental amounts resulting from the Revised Estimate in accordance with the schedule set forth in the Revised Exhibit A (each an “RE Payment”). Provided, however, that no RE Payment shall be due or payable less than ten (10) days after receipt of such notice, unless the parties otherwise agree in writing to another date. 2.07 If NECEC disputes a Revised Estimate (a “RE Dispute”), then NECEC shall pay to Affected Party all disputed and undisputed amounts in accordance with the Revised Exhibit A and may, within fifteen (15) business days following receipt of a Revised Estimate and a Revised Exhibit A, provide written notice to Affected Party of the RE Dispute, including the basis for the dispute. The Parties may submit any RE Dispute to the dispute resolution procedures set forth in Section 8.07 of this Agreement. 2.08 Affected Party may suspend E&P Activities (i) when (x) the commitment of E&P Costs associated with further E&P Activities and (y) cancellation fees associated with E&P Activities are greater than the remaining Initial Payment, Milestone Payments, RE Payments and Payment Security, as applicable, or (ii) if NECEC fails to submit an RE Payment associated with an RE Dispute. Affected Party shall provide notice to NECEC of its intention to suspend E&P Activities in writing and NECEC shall have five (5) days thereafter to cure prior to suspension; provided, however, if the commitment of E&P Costs associated with further E&P Activities is greater than the remaining funds from the Initial Payment, Milestone Payments and RE Payments received by Affected Party and Payment Security, no notice or cure period shall be required and Affected Party shall be entitled to immediately suspend the E&P Activities; provided, further, that Affected Party shall use “Reasonable Efforts,” as defined in Section 8.01 of this Agreement, to provide NECEC no less than five (5) days’ notice before the commitment of E&P Costs associated with further E&P Activities and cancellation fees are expected to become greater than the remaining funds from the Initial Payment, Milestone Payments and RE Payments received by Affected Party and Payment Security. ARTICLE III. OBLIGATIONS OF THE AFFECTED PARTY 3.01 Engineering and Procurement. Subject to receipt of Milestone Payments and Payment Security, Affected Party shall use Reasonable Efforts to procure all necessary materials and equipment and will continue the detailed design and engineering work related to the Procurement and Design Phase as reasonably necessary to complete the Procurement and Design Phase in accordance with the Milestone Schedule set forth on Exhibit B. 3.02 Record Keeping. Affected Party shall establish and maintain records that will reasonably identify the Affected System’s E&P Costs, and use of funds related to this Agreement. 3.03 Periodic Updates. On a quarterly basis, the Affected Party shall provide NECEC with an update regarding its progress with respect to of achievement of the E&P Activities (or delays thereto, if any) and an estimate of the E&P Costs incurred to date, on an aggregated basis. ARTICLE IV. OBLIGATIONS OF NECEC 4.01 NECEC shall promptly provide to Affected Party all information necessary to perform the activities associated with this Agreement upon request of Affected Party. 4.02 Payments. (a) NECEC shall make each Milestone Payment in accordance the schedule set forth in Exhibit A. (b) NECEC shall make each RE Payment in accordance with Section 2.06. (c) If NECEC receives a Termination Invoice in accordance with Section 5.02(e) indicating that amounts are due from NECEC to the Affected Party, NECEC shall pay such invoice within thirty (30) days of receipt. 4.03 NECEC shall use Reasonable Efforts to promptly inform Affected Party of any change to the proposed commercial operation date (currently December 2024) of the Facility, but in no event shall a failure to promptly inform constitute a breach of this Agreement. ARTICLE V. TERMINATION AND SUSPENSION 5.01 Suspension By NECEC. NECEC may, at any time and in its sole discretion, by written notice to the Affected Party, suspend the performance of all E&P Activities. If the E&P Activities are so suspended, the date for the completion of each then uncompleted Milestone on Exhibit B that is affected by the suspension and Milestone Payments set forth in Exhibit A (or Revised Exhibit A) that are due after the date of suspension shall be deemed automatically to be extended for a period of time equal to the duration of the anticipated suspension period. (a) Upon receipt of any such suspension notice, the Affected Party shall: (i) use Reasonable Efforts to direct subcontractors and employees immediately to discontinue all E&P Activities; (ii) place no further orders or subcontracts for material, services, or facilities with respect to the E&P Activities; (iii) suspend all engineering subcontracts and, to the extent reasonably practicable, suspend all materials purchases; (iv) exercise Reasonable Efforts to minimize cost or expenses arising out of the suspension, if any; and (v) as soon as reasonably practicable, inform NECEC of any additional E&P Costs, if any, arising from such suspension. (b) In the event of a request to suspend, NECEC and the Affected Party will continue communications and coordination regarding their obligations under this Agreement and the E&P Activities. (c) NECEC ACKNOWLEGES THAT A REQUEST TO SUSPEND MAY DELAY COMPLETION OF THE E&P ACTIVITIES PROVIDED FOR UNDER THIS AGREEMENT BEYOND AFFECTED SYSTEM’S FALL 2024 PLANNED OUTAGE AND/OR MAY, CONSISTENT WITH GOOD UTILITY PRACTICE, CAUSE A DELAY BEYOND THE FALL 2024 PLANNED OUTAGE FOR THE INSTALLATION OF THE NEW 24.5 KV GENERATOR CIRCUIT BREAKER AND ANCILLARY EQUIPMENT. 5.02 Termination By NECEC. NECEC may, at any time and in its sole discretion, by written notice to the Affected Party, terminate the performance of all E&P Activities. Should NECEC elect to so terminate the E&P Activities, the Affected Party shall (with respect to the E&P Activities): (a) use Reasonable Efforts to direct subcontractors and employees immediately to discontinue all E&P Activities; (b) place no further orders or subcontracts for material, services, or facilities; (c) terminate all engineering subcontracts and materials purchases; (d) to the extent any order for equipment cannot be cancelled, the Affected Party may elect to (i) take title to the equipment, in which case the Affected Party shall refund to NECEC any E&P Costs paid by it for such equipment; provided, NECEC shall be responsible for the cost of delivery of such equipment, or (ii) transfer title to and deliver such equipment to NECEC, subject to Affected Party’s prior receipt of any RE Payment and the payment by NECEC for the cost of delivery of such equipment. (e) as soon as reasonably practicable, inform NECEC if any amounts incurred by Affected Party exceeds the amount paid by NECEC prior to the termination date, Affected Party shall invoice NECEC for such additional amounts (including, without limitation, amounts related to winding up E&P Activities and E&P Costs incurred in connection with the cancellation of third-party contracts) and NECEC shall pay such amount to Affected Party within thirty (30) days of receipt of such invoice; (f) exercise Reasonable Efforts to minimize cost or expenses arising out of termination; and (g) maintain books and records supporting all costs charged to NECEC in connection with the termination, and as soon as reasonably practicable provide NECEC with an invoice for all costs due in connection with its termination including all required termination payments (the “Termination Invoice”) and, if any amounts paid by NECEC pursuant to this Agreement prior to termination remain unspent after completion of the E&P Activities contemplated by this Agreement or after paying those E&P Costs associated with the termination of this Agreement shall be returned to NECEC within thirty (30) days. 5.03 Termination Costs. Exhibit C hereto depicts the cancellation payment schedules included in the engineering package contract between Affected Party and Hitachi Energy USA Inc. (“Hitachi”) (the “LNTP Contract”) and the equipment supply contract between Affected Party and Hitachi (the “FNTP Contract”). NECEC acknowledges that should it exercise its right to terminate E&P Activities in accordance with Section 5.02, the cancellation payment schedules in Exhibit C depict projections only and if actual costs incurred by Hitachi are greater than those in Exhibit C, NECEC remains responsible for such costs. In addition to such payments, should NECEC terminate E&P Activities, NECEC remains responsible for costs incurred by other Affected Party subcontractors and costs incurred by Affected Party and its affiliates in accordance with Section 4.02(c). ARTICLE VI. ADDITIONAL AGREEMENTS 6.01 Implementation and Installation Reimbursement Agreement. The Parties agree and acknowledge that completion of the Upgrade will require the Parties enter into an additional agreement with respect to the installation, implementation, testing and commissioning of the 24.5 kV generator circuit breaker and ancillary equipment, with the goal of completing the upgrade during the Fall 2024 Planned Outage. Each Party covenants that it will work in good faith to negotiate an agreement pursuant to which NECEC shall reimburse and pay Affected Party all internal and external costs (including labor and material), fees, and expenses incurred by Affected Party and its affiliates with respect to the installation, implementation and testing of the 24.5 kV generator circuit breaker and ancillary equipment, and which will be entered into and filed with the FERC at the earlier of thirty (30) days prior to the delivery of the 24.5 kV generator circuit breaker, and one hundred twenty (120) days prior to the start of the Fall 2024 Planned Outage.
